export default function Login() {
  return (
    <div className="auth-page">
      <div className="auth-card">
        <h2>Login</h2>
        <input placeholder="Email" />
        <input placeholder="Password" type="password" />
        <button>Login</button>
      </div>
    </div>
  );
}
